import { useUser } from "../components/auth/useUser.js";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
	const navigate = useNavigate();
	const { username, email } = useUser();

	return (
		<div>
			<h1>{username}</h1>
			<h2>{email}</h2>
			<div>
				<button
					onClick={() => {
						localStorage.removeItem("token");
						navigate("/login");
					}}
				>
					LogOut
				</button>
			</div>
		</div>
	);
};

export default Dashboard;
